import './hero.css'
import {Button} from '../Button/button';

class Hero extends React.Component{
    render(){
        return(
        <div className='hero'>
            <div className="container">
                <div className="text">
                    <h1>Woo</h1>
                    <h1>Woo</h1>
                    <h1>Network</h1>
                    <div className="sign-up-buttons">
                        <Button>Learn More</Button>
                    </div>
                    <h2>Class aptent taciti sociosqu
    ad litora torquent per conubia nostra  </h2>
                </div>
            </div>
        </div>


);
}
}

export default Hero
